description:
Remember when Lindsay Lohan was kinda cute and hot? Here she is, 19 years old, in a lavender top &amp; jeans on the Tony Danza Show. She talks/lies about her life in general and her then-debut album &quot;Speak&quot;. The album is actually pretty decent pop. I bought it.

